import React from "react";
import "./Home.css";
import tshirt1 from'./Black T-shirt.jpg';
import tshirt2 from'./Green-sweater.jpg';
import tshirt3 from'./Red-hoodie.jpg';
import tshirt4 from'./Blue -Jacket.jpg';
const Navbar = () => (
  <nav className="navbar">
    <h2>My Store</h2>
  </nav>
);

const Home = () => {
  return (
    <div>
      <Navbar />
      <div className="container">
        <div className="card">
          <img src={tshirt1} alt="Black T-Shirt" />
          <h3>Black T-Shirt</h3>
          <p>$1200</p>
          <button>Add to Cart</button>
        </div>

        <div className="card">
          <img src={tshirt2} alt="Green Sweater" />
          <h3>Green Sweater</h3>
          <p>$2000</p>
          <button>Add to Cart</button>
        </div>

        <div className="card">
          <img src={tshirt3} alt="Red Hoodie" />
          <h3>Red Hoodie</h3>
          <p>$1500</p>
          <button>Add to Cart</button>
        </div>

        <div className="card">
          <img src={tshirt4} alt="Blue Jacket" />
          <h3>Blue Jacket</h3>
          <p>$2500</p>
          <button>Add to Cart</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
